    data: |
      SELECT ALL + col1 + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 56 NOT BETWEEN ( + - col0 ) AND ( - 60 ) * + col2;
  - name: tab2

outputs:
  - name: q234.out
    data: |
      141
      142
      97
